  false,\n\t\"url\": null,\n\t\"notes\": \"In 1984, the U.S. Geological Survey (USGS),
  Office of Marine Geology, launched a program using the Geological LOng-Range Inclined
  Asdic (GLORIA) sidescan-sonar system to study the entire U.S. Exclusive Economic
  Zone (EEZ). From 1988 through 1991, as part of that program, the USGS and IOS (Institute
  of Oceanographic Sciences, U.K.) scientists conducted nine cruises within the U.S.
  EEZ off Hawaii. The surveys during that time period focused on the central Hawaiian
  region. The results of these surveys were 24 digital mosaics of approximately a
  2 degree by 2 degree area with a 50-meter pixel resolution. As in earlier EEZ reconnaissance
  surveys, the USGS utilized the GLORIA (Geological LOng-Range Inclined Asdic) sidescan-sonar
  system to complete the geologic mapping. The collected GLORIA data were processed
  and digitally mosaicked to produce continuous imagery of the sea-floor.\",\n\t\"license_title\":
